import styled from "styled-components";

export const Wrapper = styled.button`
  background: var(--darkGrey);
  border: none;
  border-radius: 30px;
  color: var(--white);
  font-size: var(--fontBig);
  display: block;
  padding: 10px;
  width: 25%auto;
  min-width: 200px;
`;
